import React from "react";
import Modal from "../../Layout/Modal";

import classes from "./ChangePasswordModal.module.css";

const ChangePasswordModal = () => {
  return (
    <Modal>
      <form className={classes.container}>
        <input type="password" />
      </form>
    </Modal>
  );
};

export default ChangePasswordModal;
